import './App.css';
import ColorGradient from "./components/ColorGradient"

function App() {
  return (
    <div className="App">
      <canvas id="myCanvas" width="200" height="100"
      style="border:1px solid #d3d3d3;">
      Your browser does not support the canvas element.
      </canvas>
      <ColorGradient />
    </div>
  );
}

export default App;
